(100030, 'Thi công vườn trên mái nhà', 'Một khu vườn xanh trên mái nhà ngoài việc giúp căn hộ của bạn thêm độc đáo, thể hiện cá tính của chủ nhân, còn tạo những khoảng không gian xanh gần gũi với thiên nhiên.\r\nSản phẩm miếng lót nhựa Versicell từ Đức (Công ty Nam Ánh Dương nhập) phục vụ việc [ … ]', , '2017-05-31', 550, 1005);
