(100031, 'Những ngôi nhà của tương lai', 'Những ngôi nhà dưới đây đều có thiết kế nổi bật, độc đáo, thậm chí là kỳ dị. Chúng cho thấy sức sáng tạo vô biên của con người. Trong tương lai, có thể bạn sẽ ở một trong những ngôi nhà như vậy.\r\n\r\nMercuryHouseOne\r\nMercuryHouseOne được hình thành bởi nhà thiết kế Arturo Vittor, kiến trúc sư người Italy [ … ]', , '2017-05-28', 444, 1005);
INSERT INTO `new` (`id_new`, `name_new`, `recap_new`, `image`, `date`, `view`, `id_list`) VALUES
(100032, 'Không gian sống tinh tế với Dome', 'Không gian sống có lối kiến trúc đơn giản, hiện đại kết hợp cùng nội thất phảng phất chất Á Đông cách tân tạo nên sự sang trọng là một trong những điểm đặc trưng của Dome trong mỗi công trình.\r\nNhững không gian sống có kiến trúc hiện đại, đơn giản luôn tạo được sự thông thoáng, khoáng đạt. Khi đã có [ … ]', , '2017-05-06', 690, 1005);
INSERT INTO `new` (`id_new`, `name_new`, `recap_new`, `image`, `date`, `view`, `id_list`) VALUES
(100033, '3 cách giúp gian bếp thông thoáng', 'Không gian bếp là nơi hội họp lý tưởng của những bữa ăn đầm ấm nhưng lại có thể ẩn chứa nhiều nguy cơ ô nhiễm. Tham khảo những mẹo nhỏ sau sẽ giúp bạn thoải mái nấu nướng trong không khí trong lành.\r\nNgoài việc thu hút ánh sáng thiên nhiên vào nhà, cửa sổ còn có tác dụng hiệu quả trong việc điều tiết [ … ]', , '2017-05-29', 300, 1005);
INSERT INTO `new` (`id_new`, `name_new`, `recap_new`, `image`, `date`, `view`, `id_list`) VALUES
(100034, 'Thiết kế xanh cho trường học', 'Kiến trúc của trường THCS và PTTH Phan Chu Trinh nằm tại Dĩ An, tỉnh Bình Dương tạo ra hệ thống thông gió tự nhiên cho không gian hành lang. Điều này giúp các em học sinh cảm thấy thiên nhiên như bên cạnh.\r\nTrường THCS & PTTH Phan Chu Trinh nằm tại Dĩ An, tỉnh Bình Dương. Thành phố Bình Dương nằm [ … ]', , '2017-05-30', 490, 1005);
INSERT INTO `new` (`id_new`, `name_new`, `recap_new`, `image`, `date`, `view`, `id_list`) VALUES
(100035, '\r\nCây xanh cho nhà chung cư', '\r\nBố trí một vài chậu cảnh trong nhà chung cư có thể giúp không gian thoáng đãng và thân thiện hơn.\r\nKhi thiết kế nhà phố, gia chủ thường dành một khoảng lùi nhất định để làm sân vườn xanh mát cho ngôi nhà. Tuy nhiên, đối với nhà chung cư, chuyện thiếu cây xanh đã trở nên rất phổ biến bởi không có khoảng [ … ]', , '2017-05-07', 450, 1005);
INSERT INTO `new` (`id_new`, `name_new`, `recap_new`, `image`, `date`, `view`, `id_list`) VALUES
(100036, '\r\nTự thiết kế một khu vườn xinh', 'Năm bước căn bản dưới đây sẽ giúp ích cho bạn rất nhiều trong việc tạo cho mình một khu vườn nhỏ - nơi bạn có thể tìm cho mình chút bình yên giữa cuộc sống hối hả hàng ngày.\r\n1. Lên kế hoạch kỹ lưỡng trước khi bắt đầu\r\nCũng giống như trước khi bắt đầu [ … ]\r\n ', , '2017-05-03', 438, 1006);
INSERT INTO `new` (`id_new`, `name_new`, `recap_new`, `image`, `date`, `view`, `id_list`) VALUES
(100037, 'Cho góc vườn xinh càng thêm xinh', 'Chỉ với vài thay đổi đơn giản trên lối xuống khu vườn nhỏ của bạn\r\nSơn thêm một chút\r\n \r\nHãy thể hiện khả năng nghệ thuật của bạn bằng vài đường cọ trên hàng rào và trên lối đi bằng gỗ. Không quan trọng là nó đẹp đến cỡ nào, quan trọng là thể hiện được cái tôi của bạn.  \r\nTreo vài chậu nhỏ', , '2017-05-20', 650, 1006);
INSERT INTO `new` (`id_new`, `name_new`, `recap_new`, `image`, `date`, `view`, `id_list`) VALUES
(100038, 'Vườn treo cho nhà đẹp', 'Nếu bạn yêu thích cây xanh nhưng ngôi nhà của bạn không còn khoảng không gian nào để trồng cây thì “vườn treo” này thật sự là một giải pháp tuyệt vời cho bạn.\r\nGiải pháp mới để tạo ra một khu vườn cho những không gian nhỏ này được thiết kế bởi Patrick Morris, một sinh viên tốt nghiệp trường Central Saint [ … ]\r\n ', , '2017-05-31', 328, 1006);
INSERT INTO `new` (`id_new`, `name_new`, `recap_new`, `image`, `date`, `view`, `id_list`) VALUES
(100039, 'Lá phổi xanh cho ngôi nhà', 'Để thanh lọc không khí cho ngôi nhà của bạn, chỉ vài chậu cây cảnh là bạn đã có một dàn bảo vệ xanh đủ sức đánh bật những chất độc hại đang âm mưu chui vào phổi.\r\nCác nghiên cứu khoa học chứng minh đa số các loại vật liệu xây dựng và trang trí nội thất đều ít nhiều gây tác hại cho sức khỏe con người. [ … ]', , '2017-05-01', 411, 1006);
INSERT INTO `new` (`id_new`, `name_new`, `recap_new`, `image`, `date`, `view`, `id_list`) VALUES
(100040, '\r\nHương và sắc khu vườn theo phong thủy', 'Chúng ta phản ứng với khu vườn của mình thông qua cảm xúc và các giác quan, hương thơm, màu sắc và càm giác khi chạm nhẹ vào những bông hoa, cành lá.\r\nHương thơm của một loại cây chúng ta yêu thích có thể mang lại cảm giác ngây ngất và khi đưa tay vuốt nhẹ những chiếc lá phủ lớp lông mịn của cây môi [ … ]', , '2017-05-06', 301, 1006);

